import './App.css';
import SearchEngine from "./searchEngine";
import CityInfo from "./cityInfo";
import Forecast from "./forecast";


function App() {
  return (
    <div className="App">
      <div className='appContainer'>
        <div className='box-1'>
      <SearchEngine></SearchEngine>
      <CityInfo></CityInfo>
      </div>
      <Forecast></Forecast>
      </div>
    </div>


  );
}

export default App;
